import React from "react";
import {useForm} from 'react-hook-form'
import {Link} from 'react-router-dom';
import arrow from '../../assets/home/icons/CheckIn/arrow-left.svg'
import Login from "./Login";
import reset from '../../assets/home/icons/CheckIn/resetPassword.svg';
import ApprovedPassword from '../authentification/ApprovedPassword';



export  default function NewPassword () {
const form = useForm();
    return(
        <section className="modal">
            <form>
                {/* <img className="form_img" src={reset} alt="enter new password"/> */}
            <h1>Set New Password</h1>
            <p>Your new password must be different from previously used passwords.</p>
            
                <label>New Password</label>
                <input type="password" placeholder="Enter your password"/>
                <label>Confirm Password</label>
                <input type="password" placeholder="Enter your password"/>
                <Link to="/login/approvedPassword" element={<ApprovedPassword/>}>
                
                <button className="btn_submit" type="submit"> Reset Password</button>
                </Link>
                <section className="additionals">
                <Link to="/login" element={<Login/>}>
          <button><img src={arrow} alt="back to login"/> Back to Login</button>
                </Link>
            </section>
            </form> 
        </section>
    )
}
